  libdata[libdataItem++] = new Array("./pp_cubecollection__define.html#pp_cubecollection::init", "pp_cubecollection::init", 'routine in <a href="./pp_cubecollection__define.html">pp_cubecollection__define.pro</a>', "pp_cubecollection__define.pro", "Paulo Penteado (pp.penteado@gmail.com), Nov/2009  ", "pp_cubecollection::init", "    Initializes a pp_cubecollection object, either from a previously built file,     or builds the file from cube files.   ", "build      If set, the cubes named in cubefiles are read from disk and the container file is created.       Otherwise, it is assumed the container file was previously created, and the object gets       its data from that file.  cubefiles      If build is set, a string array with the names of the cube files to read. If absent and build is       set, all cubes found in the current directory (ending with '_eg.cub', '_ir_eg.cub', or '_vis_eg.cub',       depending on the vis and ir keywords) are used, and their names are returned in this keyword.  vis      If set, cubes matching '*_vis_eg.cub' are used when building the container file, instead of '*_eg.cub'.  ir      If set, cubes matching '*_ir_eg.cub' are used when building the container file, instead of '*_eg.cub'.   compresssavefile      The name of the file that either will contain the object's data, or the data will be       read from, depending on the build keyword.   ", "          -1", "    See the example on pp_editablecube__define.   ");
  
